import React from 'react';
import './BannerSection.css';

const BannerSection = () => {
  return (
    <div className='header-banner-section'>
        <div className="content">
            <div className="content-details">
                <h1>Groceries Delivered in 90 Minute</h1>
                <p>Get your healthy foods & snacks delivered at your doorsteps all day everyday</p>

                <div className="search_input">
                    <input type="text" className='input_feild h-full w-full' autoComplete='off'  />
                    <button className='btn_search'>Search</button>
                </div>

            </div>
            
        </div>

    </div>
  )
}

export default BannerSection
